import React from "react";
import { Layout, Header, Navigation, Drawer, Content } from "react-mdl";

export const Website = () => {
  return (
    <div style={{ height: "300px", position: "relative" }}>
      <Layout fixedHeader fixedDrawer>
        <Header title="Title">
          <Textfield
            value=""
            onChange={() => {}}
            label="Search"
            expandable
            expandableIcon="search"
          />
        </Header>
        <Drawer title="Title">
          <Navigation>
            <a href="/">Link</a>
            <a href="/">Link</a>
            <a href="/">Link</a>
            <a href="/">Link</a>
          </Navigation>
        </Drawer>
        <Content />
      </Layout>
    </div>
  );
};
